import {makeStyles} from "@material-ui/core/styles"

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        height: 140,
        width: 100,
        backgroundColor: '#ddd',
        margin: '0 auto 25px',
    },
    control: {
        padding: theme.spacing(2),
    },

    cdp: {
        position: 'relative',
        textAlign: 'center',
        padding: '20px 0',
        fontSize: 0,
        zIndex: 6,
        margin: '50px 0',
    }
}))

export default useStyles
